  `user_score1` int(11) NULL DEFAULT 0 COMMENT '游戏人员2分数',
  `user_state1` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '游戏人员2在线状态（0：未准备 1：已准备 2：掉线 3：人机）',
  `user_id2` int(11) NULL DEFAULT NULL COMMENT '游戏人员3id',
  `user_icon2` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '游戏人员3头像',
  `user_name2` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '游戏人员3昵称',
  `user_score2` int(11) NULL DEFAULT 0 COMMENT '游戏人员3分数',
  `user_state2` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '游戏人员3在线状态（0：未准备 1：已准备 2：掉线 3：人机）',
  `user_id3` int(11) NULL DEFAULT NULL COMMENT '游戏人员4id',
  `user_icon3` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '游戏人员4头像',
  `user_name3` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '游戏人员4昵称',
  `user_score3` int(11) NULL DEFAULT 0 COMMENT '游戏人员4分数',
  `user_state3` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '游戏人员4在线状态（0：未准备 1：已准备 2：掉线 3：人机）',
  `ip` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '房间服务器ip',
  `port` int(11) NULL DEFAULT 0 COMMENT '端口',
  `makers` int(11) NULL DEFAULT NULL COMMENT '庄家',
  PRIMARY KEY (`uuid`) USING BTREE,
  UNIQUE INDEX `uuid`(`uuid`) USING BTREE,
  UNIQUE INDEX `id`(`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1007 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

