  `tili` int(11) NULL DEFAULT 0 COMMENT '用户体力值',
  `roomid` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '房间id',
  `history` varchar(4096) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'token',
  `user_online` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户游戏在线状态',
  `fraction` int(11) NULL DEFAULT 0 COMMENT '分数',
