  `guildid` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '公会id(数组)',
  `guild_roomid` int(11) NULL DEFAULT NULL COMMENT '公会房间id',
  `petty_cash` int(11) NULL DEFAULT 0 COMMENT '备用金',
  PRIMARY KEY (`userid`) USING BTREE,
  UNIQUE INDEX `account`(`account`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 79 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

